import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "./Notes";

console.log(notes);

function App() {
  return (
    <div>
      <Header />
      <Note title="This is a note title" content="This is the note content" />
      <Footer />
    </div>
  );
}
export default App;
